(window.webpackJsonp=window.webpackJsonp||[]).push([[10],{340:function(s,e){s.exports='<div class="vertical layout">\n  <div class="friend-chat">\n    <div>\n      <img class="address" src="https://www.theladders.com/wp-content/uploads/Mentally_Stron_040418-800x450.jpg" alt="">\n      <h3>[[name]]</h3>\n      <span>online</span>\n    </div>\n    <div>\n      <img class="phone" (click)="startCall(evt)" src="https://cdn.shopify.com/s/files/1/1854/1819/files/phone-blue-icon.png?16594292423607258669" alt="">\n    </div>\n  </div>\n\n  <div id="messagesPane" class="messages flex">\n    <xin-for items="[[messages]]" as="message">\n      <template>\n        <div class="line" class.my="[[isMyChat(message.address)]]">\n          <span class="name">[[message.address]]</span>\n          <p class="chat">[[message.content]] <span>[[message.t]]</span></p>\n        </div>\n      </template>\n    </xin-for>\n  </div>\n\n  <form class="message layout">\n    <input id="messageField" class="flex form-control" type="text" placeholder="Write your message..." value="{{form.message}}">\n    <input type="submit" (click)="sendMessage(evt)" class="btn btn-info" value="Send">\n  </form>\n</div>\n'}}]);